Once an alligator bites, there is no escape! Extension number 82, better known as the &quot;Gator Branch&quot; is an undercover police branch that is relentless when it comes to apprehending criminals. In a dynamic motion picture adaptation of the popular comic book series &quot;Wani Bunsho&quot;, Emi Yokoyama and Kaoru Janbo star as two gritty female investigators who conduct intricate sting operations.

Mika Hino is a sharp-shooting investigator that belongs to the infamous Gator Branch. When an executive board member of a trading company is accused of being involved in bribery, Mika is assigned to keep watch over him. A few nights later her target is found dead outside of his 30 floor office building. With an apparent suicide note as evidence, local police conclude the case as a suicide. Mika's assignment may have ended in failure, but her mission has just begun.


